import React from 'react';
import './Exchanger.scss';
import {Input} from "./Input"
import {Label} from "./Label"
import {Legend} from "./Legend"

class Exchanger extends React.Component {
  constructor(props) {
    super (props);
  }

  render () {
    return (
        <fieldset className="app-exchanger">
            <Legend currency="USD">Enter currency in $, USD</Legend>
            <Label currency="USD"></Label>
            <Input currency="USD"></Input>
        </fieldset>
    );
  }
}


export {Exchanger};
